import React from "react";
import "./Services.css";

function Services() {
  return (
    <section className="services">
      <h2>Наші послуги</h2>
      <div className="service-cards">
        <div className="card">
          <img
            src="data:image/jpeg;base64,"
            alt="Номер готелю"
          />
          <h3>Розкішні номери</h3>
          <p>Номери з найкращим комфортом та виглядом.</p>
        </div>
        <div className="card">
          <img
            src="data:image/jpeg;base64,"
            alt="СПА-зона"
          />
          <h3>СПА та релакс</h3>
          <p>Повноцінний відпочинок для вашого тіла та душі.</p>
        </div>
        <div className="card">
          <img
            src="data:image/jpeg;base64,"
            alt="Ресторан"
          />
          <h3>Ресторани</h3>
          <p>Спробуйте страви від шеф-кухарів світового рівня.</p>
        </div>
      </div>
    </section>
  );
}

export default Services;
